script: |
  super -f text -I q8556.spq | sort > q8556.out

inputs:
  - name: q8556.spq
    data: |
      SELECT ALL - + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE 38 * - col1 NOT BETWEEN - - col2 + + - 33 AND + 30;
  - name: tab0

outputs:
  - name: q8556.out
    data: |
      -10
      -47
      -99
